# If you are trying to create your own animation with our script
# we provide you with some python .ipynb files (for google colab)
# so that you can extract the data you need from a video
# 
# There are three files, and you need to use them in the following order:
# 
# 1. first you need to use the deconstruct_video, in order to extract
#		 the frames and the audio from the video.
# 
# 2. next you need to use the Get_Video_Data in order to create a data_image.txt
#		 with the data required for the animation
# 
# 3. And for last you need to use the Get_Audio_Data in order to create a Audio_data.txt
#		 with the data necessary to play the audio
# 
# Then you will have a data_image.txt and Audio_data.txt files 
# with the data that you need to copy into the GIF and AUD sección respectively
# on .data sección at the end of the script, replacing the default data.
# 
# We ask you to be careful with changing any command in this project
# THANKS.
