/* Cyclone V FPGA devices */
	.equ	PS2_BASE,				0xFF200100
	.equ	TIMER_BASE,				0xFF202000
	.equ	AUDIO_BASE,				0xFF203040

/*******************************************************************************
*CONSTANTS
*******************************************************************************/
.equ	SDRAM_END,				0x03FFFFFF
.equ	X_ALIGN,	120
.equ	Y_ALIGN,	80
.equ LOG2_BYTES_PER_ROW, 10
.equ LOG2_BYTES_PER_PIXEL, 1
.equ PIXBUF, 0x08000000	# Pixel buffer. Same on all boards.

.equ X_MASK,	0x7F0000
.equ Y_MASK,	0x3F800000
/*******************************************************************************
*CONSTANTS
*******************************************************************************/

##################------------------------------------------####################

/*******************************************************************************
****************				EXCEPTIONS				************************	
*******************************************************************************/

.section .exceptions, "ax"

.global	ExceptionHandler

ExceptionHandler:
	subi	sp, sp, 20				# make room on the stack
	stw	et, 0(sp)
	stw	r12,	12(sp)
	stw	r13,	16(sp)

	rdctl	et, ctl4 # read the control register 4 (ipending)
	
	beq		et, r0, SKIP_EA_DEC		# interrupt is not external
	subi	ea, ea, 4				# must decrement ea by one instruction
										#  for external interrupts, so that the
										#  interrupted instruction will be run
										
SKIP_EA_DEC:
	stw		ea, 4(sp)				# save all used registers on the Stack
	stw		ra, 8(sp)				# needed if call inst is used*/
REVISAR_INTR:
	bne		et, r0, CHECK_AUD	# interrupt is an external interrupt*/

NOT_EI:								# exception must be unimplemented instruction or TRAP
	br		END_ISR					# instruction. This code does not handle those cases

CHECK_AUD:# Check if the audio interruption has been activated
	
	andi	r12, et, 0b1000000
	beq		r12, r0, CHECK_TIME # Otherwise go to check_time
	
	movia	r12,	AUDIO_BASE
	
	# Load the next audio data
	ldw		r13,	AUD(r3)
	
	rol	r13,	r13,	r4	# Chage the volume
	
	# Send the audio data to the Audio Write FIFO
	stwio		r13,	12(r12)
	stwio		r13,	8(r12)
	
	# Next audio data
	beq	r3,	r0,	I1
	subi	r3,	r3,	4
	br		CHECK_TIME
I1:	# Rewind the audio if it was the last
	movia	r3,	31996
	
CHECK_TIME:/****************Check Timer******************/

	andi	r12, et, 0b1
	beq		r12, r0, CHECK_PS2 # Otherwise go to check_ps2 (for volume)
	
	################Clean Timer#################
	
	movia	r12,	TIMER_BASE
	sthio	r0,	0(r12)	#Clean the timer event
	
	################Clean Timer#################
	
	/******************Calling for draw a frame*******************/
	
	call	DrawFrame
	
	/******************Calling*******************/

CHECK_PS2:# Check if the PS2 interruption has been activated
	
	andi	r12, et, 0b10000000
	beq		r12, r0, END_ISR # Otherwise end the process
	
	# Call PS2Handler to handle keyboard interruption
	call PS2Handler

END_ISR:
	ldw	r12,	12(sp)
	ldw	r13,	16(sp)
	ldw		et, 0(sp)				# restore all used register to previous values
	ldw		ea, 4(sp)	
	ldw		ra,	8(sp)
	addi	sp, sp, 20

	eret
	
	
/****************************************PS2-Code********************************************/
# r21: auxiliar
# r4: handles the volume
PS2Handler:
	
	# Save some registers
	subi	sp,	sp,	12
	stw	ra,	0(sp)
	stw	r20,	4(sp)
	stw	r19,	8(sp)
	
	# Read the instruction
	movia	r20,	PS2_BASE
	ldwio	r20,	(r20)
	andi	r20,	r20,	0xFF
	
S1:	# Check for the prefix (Step 1)
	
	movia	r19,	0xE0
	bne	r20,	r19,	S2
	
	# Save the prefix
	mov	r21,	r19
	br	End
	
S2:	# If that was not the prefix (Step 2)
	
	# Check if there was already a prefix
	bne	r21,	r19,	End	# Otherwise End (by lack of logic)
	
	# If there was already a prefix, clean it and continue
	mov	r21, r0

Up:	# Check for up arrow
	movia	r19,	0x75
	bne	r19,	r20,	Down # Else, check for down Arrow
	
Increase:	# If it was an Up arrow, increase thevolume
	
	# Check for upper limit
	movi	r19,	18
	bge	r4,	r19,	End
	
	# Add one to volume
	addi	r4,	r4,	1

Down:	# Check for down arrow
	movia	r19,	0x72
	bne	r19,	r20,	End	# Else end the process
	
Decrease:	# If it was an Up arrow, decrease thevolume
	
	beq	r4,	r0,	End	# Check the lower limit
	# substract one to the volume for down arrow
	subi	r4,	r4,	1
	
End:	#yeah, the end of the function
	
	ldw	ra,	0(sp)
	ldw	r20,	4(sp) #Load all saved registers
	ldw	r19,	8(sp)
	addi	sp,	sp,	12
	ret

/****************************************Image-Code********************************************/
# r2:  Offset of the start of the frame to draw
DrawFrame:
	# Save some registers
	subi sp, sp, 16
    stw r6, 0(sp)
    stw r7, 4(sp)
    stw r5, 8(sp)
    stw ra, 12(sp)
	# Save some registers
	
Init:
	
	# read the next pixel data
	ldw	r6,	GIF(r2)
	
	# Check the command into the world (bits 30-31)
	andhi	r7,	r6,	0xc000	
	beq	r7,	r0,	Draw	#If the command is 00, then the word is a pixel and a coordinate
	
	# Else, it could be the end of a frame (01), or the end of the animation (1x)
	
	# Anyway we increase r2 by 4
	movi	r5,	4
	add	r2,	r2,	r5
	
	srli	r7,	r7,	30
	movi	r5,	1
	beq	r5,	r7,	Final # Check for the end of a frame, and stops to draw
	
	# If it is the end of the animation
	movi	r2, 0 # Restart the animation
	
	# Clean (Using CW bit) and Restart the Audio-Buffer
	movia	r6,	AUDIO_BASE
	movi	r7, 0b1000	
	sthio	r7,	(r6)
	movia	r3, 31996
	movi	r7, 0b10
	sthio	r7,	(r6)
	
Final: # End (of the frame or the animation)
	# Reloading registers
	ldw ra, 12(sp)
	ldw r5, 8(sp)
	ldw r7, 4(sp)
    ldw r6, 0(sp)
	addi sp, sp, 16
	# Reloading registers
	ret
	
Draw:	# For draw a Pixel
	
	# Get the X-coordinate from the data bits(16 to 22), and align it
	movia	r5,	X_MASK
	and	r7,	r6,	r5
	srli	r7,	r7,	16
	addi	r7,	r7,	X_ALIGN
	
	# Get the X-coordinate from the data bits(23 to 29), and align it
	movia	r5,	Y_MASK
	and	r5,	r6,	r5
	srli	r5,	r5,	23
	addi	r5,	r5,	Y_ALIGN
	
	# And get the color code from the first 16 bits
	andi	r6,	r6,	0xffff
	
	# And Draw the pixel in the screen
	call DrawPixel
	
	# Increase r2 by 4 for the next pixel
	movi	r7,	4
	add	r2,	r2,	r7
	
	br Init
	
	
#######################--------------------------########################

# r6: colour
# r7: col(x)
# r5: row(y)
DrawPixel:
	# Save some registers
	subi	sp,	sp,	12
	stw	r11,	0(sp)
	stw	r12,	4(sp)
	stw	ra,		8(sp)
	# Save some registers
	
	movi r11, LOG2_BYTES_PER_ROW		# log2(bytes per row)
    movi r12, LOG2_BYTES_PER_PIXEL	# log2(bytes per pixel)
	
	# Build the direction from the pixel buffer
	sll r5, r5, r11
    sll r7, r7, r12
    add r5, r5, r7
    movia r7, PIXBUF
    add r5, r5, r7
	
	# Set the pixel color
	sthio	r6,	(r5)
	
	# Load some registers
	ldw	ra,		8(sp)
	ldw	r12,	4(sp)
	ldw	r11,	0(sp)
	addi	sp,	sp,	12
	# Load some registers
	
	ret

/*******************************************************************************
****************				EXCEPTIONS				************************	
*******************************************************************************/

