/*******************************************************************************
****************					MAIN				************************	
*******************************************************************************/
	.text
	.global _start
	
_start:
	# for start
	movia 	sp, SDRAM_END - 3
	movi	r4,	9	# Volume set to 9
	mov	r21,	r0
	
	/*************************			CONFIGURING PS2			***********************/
	
	movia	r12,	PS2_BASE
	movia	r13,	0b1		# Set RE 1
	sthio	r13,	4(r12)
	
	
	/*************************			CONFIGURING PS2			***********************/
	
	/*****************CONFIGURING AUDIO*****************/
	
	movia	r12,	AUDIO_BASE
	movia	r13,	0b10	# Set WE 1
	sthio	r13,	(r12)
	
	mov	r3,	r0
	
	/*****************CONFIGURING AUDIO*****************/
	
	/*****************CONFIGURING TIMER*****************/
	movia	r12,	3333333	# Time interval setted to 1/30 segs
							## = 1s/30 * 100MHz = 3333333
	movia	r2,	TIMER_BASE
	sthio	r12,	8(r2)	# Saving the high part
	srli	r12,	r12,	16
	sthio	r12,	0xC(r2)	# Saving the low part
	
	movi	r12,	0b0111	# Bits START, CONT, TO setted to 1
	sthio	r12,	4(r2)
	
	mov	r2,	r0
	
	/*****************CONFIGURING TIMER*****************/
	
	
	# enabling interrupts
	
	movi	r12,	0b11000001
	wrctl	ienable,	r12
	
	movi	r12,	1
	wrctl	status,		r12
	
IDLE:
	br IDLE
	
